description:
Verenigde Staten
Horror / Thriller
107 minuten

een goeie film

met Aaron Stanford, Dan Byrd en Emilie de Ravin

Een Amerikaanse familie is met de camper op reis door de woestijn van New Mexico wanneer ze opeens een auto-ongeluk krijgen. De 
auto is niet te repareren en hun mobiele telefoons hebben midden in de woestijn geen bereik. Ze proberen er het beste van te 
maken maar al snel merken ze dat er iets niet in orde is in dat gebied. Ze worden opgejaagd door misvormde lokale bewoners die 
gemuteerd zijn als gevolg van nucleaire tests door de overheid in het verleden.
